import React from "react";
import ReactDOM from "react-dom";
import Heading from './Heading';
import Country from './Country';
import  Lang from './Lang';
import Datetime from './Datetime';

function App(){
    return(
  <>
  <Heading />
  <Country />
  <Lang />
  <Datetime />
</>
    );
}

export default App;
